import React, { useState } from 'react';
import classNames from 'classnames';  // If you want to use conditional classes (optional)

const Navbar = () => {
  const [isMobileMenuOpen, setMobileMenuOpen] = useState(false);

  // Navigation items
  const navigation = [
    { name: 'Home', href: '#' },
    { name: 'About', href: '#' },
    { name: 'Services', href: '#' },
    { name: 'Contact', href: '#' },
  ];

  // Toggle the mobile menu open/close
  const toggleMobileMenu = () => setMobileMenuOpen(!isMobileMenuOpen);

  return (
    <nav className="bg-blue-600 p-4 shadow-md">
      <div className="container mx-auto flex justify-between items-center">
        {/* Logo */}
        <div className="text-white font-bold text-xl">My Logo</div>

        {/* Desktop Navigation */}
        <div className="hidden md:flex space-x-4">
          {navigation.map((item, index) => (
            <a
              key={index}
              href={item.href}
              className="text-white hover:text-yellow-400 transition duration-300"
            >
              {item.name}
            </a>
          ))}
        </div>

        {/* Mobile Menu Button */}
        <button
          onClick={toggleMobileMenu}
          className="md:hidden text-white focus:outline-none"
        >
          <svg
            className="w-6 h-6"
            fill="none"
            stroke="currentColor"
            viewBox="0 0 24 24"
            xmlns="http://www.w3.org/2000/svg"
          >
            <path
              strokeLinecap="round"
              strokeLinejoin="round"
              strokeWidth="2"
              d="M4 6h16M4 12h16M4 18h16"
            ></path>
          </svg>
        </button>
      </div>

      {/* Mobile Navigation (Hamburger Menu) */}
      {isMobileMenuOpen && (
        <div className="md:hidden bg-blue-600 p-4 space-y-2">
          {navigation.map((item, index) => (
            <a
              key={index}
              href={item.href}
              className="text-white block hover:text-yellow-400 transition duration-300"
            >
              {item.name}
            </a>
          ))}
        </div>
      )}
    </nav>
  );
};

export default Navbar;
